import React from 'react';

import { withFirebase } from '../Firebase';

function handleClick(event) {
  firebase.doSignOut
}

const SignOutButton = ({ firebase }) => (
  <button type="button" onClick={handleClick}>
    Sign Out
  </button>
);

export default withFirebase(SignOutButton);
